import { useState, useEffect } from 'react';

export default function GetProducts() {

  const [data, setData] = useState<Array<any>>();

  useEffect(() => {
    const getData = async () => {
      const resp = await fetch('/api/Products');
      const data = await resp.json();
      setData(data);
    };
    getData();
  }, []);

  return data;
}
